  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";
import RutasAnimadas from "./NavBar/RutasAnimadas";
import Burger from "./componentes/Burger/Burger";
import "./App.css"
import { useState } from "react";
import Inicio from "./NavBar/Inicio";

function App (){
  const [clase,setClase]= useState("componenteOculto");
  const [boton,setBoton]= useState("boton");
  const [hiddenDiv, setHiddenDiv]= useState("containerDivs")

const Cambio= ()=>{
  setClase("");
  setBoton("botonOculto")
  setHiddenDiv("hiddenContainerDivs")
}

return <div className="padre">
  <div className={hiddenDiv}>
    <div className="containerDivsSun">
    <div className="presentation">
      <p>
      Welcome to Lautaro's page
      </p>
      <p>
        I
      </p>
    </div>

    <div className="divOculto">
      <button className={boton} onClick={Cambio}>
      Let's start
      </button>
    </div>
    </div>
  </div>
<div className={clase}>
<Router>
  <div className="burger" >
  <Burger />
  </div>
<Inicio />
<RutasAnimadas/>         
</Router>
</div>
</div>
}
export default App;
